import { Swiper, SwiperSlide } from 'swiper/react';
import { Pagination } from "swiper";

import 'swiper/css';
import 'swiper/css/pagination';

import logo from '../img/logo.png'
import slider1 from '../img/slider1.jpg'
import slider2 from '../img/slider2.jpg'
import slider3 from '../img/slider3.jpg'

const Header = () => {
    return (
        <div classname='flex flex-row '>
            <div classname=''>
                {/* <img src={logo} alt='logo' className='block'></img> */}
                <p>aaa</p>
            </div>

            <div className='w-[30%]'>
                {/* tab */}
                <div>
                    <p className='font-bold text-xl'>aaa</p>
                </div>

                {/* swipper */}
                <div>
                    <Swiper
                        pagination={{ dynamicBullets: true }}
                        modules={[Pagination]}
                    >
                        <SwiperSlide><img src={slider1} alt='slider1'></img></SwiperSlide>
                        <SwiperSlide><img src={slider2} alt='slider2'></img></SwiperSlide>
                        <SwiperSlide><img src={slider3} alt='slider3'></img></SwiperSlide>
                    </Swiper>
                </div>

                {/* search */}
                <div>

                </div>

            </div>
        </div>
    )
}

export default Header
